After examining the transactions in the input file we note that the “Initial” entries (cash deposit, bank deposit and fixed assets) all add to asset side of the balance sheet. In contrast, “liabilities” in our system come from amounts not yet paid for a purchase (that is, items that are “Unpaid” and/or run to “Account Payable”) so that the company still owes money. In the sample data a couple of purchases were recorded as Unpaid and showed up as liabilities.

Looking over the “Purchase” transactions in the provided problem data, every Purchase (and every other transaction that might normally affect a liability account such as related “Expense” entries) is marked “Paid”. (Also note that “Interest Receivables” even if not yet received are “receivables” – that is, assets – not liabilities.) Therefore no liabilities have been “accrued” by the end of the reporting period.

It follows that at the beginning none of the opening entries were liabilities and at period‑end no unpaid purchase or similar liability adds up.

